script: |
  super -f text -I q12169.spq | sort > q12169.out

inputs:
  - name: q12169.spq
    data: |
      SELECT 95 * 62, - 40 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT col2 * + 31 / + 44 + - 1 + col0 * col1 * - - ( - col0 ) - - + 36 IS NULL;
  - name: tab0

outputs:
  - name: q12169.out
    data: |
      5890	-40
      5890	-40
      5890	-40
